ee && $json.employee.name ? $json.employee.name : ($json.name || $json.full_name || $json.fullName))\\n      || \\"Demo User\\"\\n    )}}',\\n    COALESCE((SELECT id FROM role_pick), 1),\\n    true\\n  )\\n  ON CONFLICT (email)\\n  DO UPDATE SET\\n    full_name = EXCLUDED.full_name,\\n    is_active = true\\n  RETURNING id\\n),\\nins_employee AS (\\n  INSERT INTO \\"Core\\".employees (user_id, hire_date, probation_end, is_active)\\n  SELECT\\n    upsert_user.id,\\n    CURRENT_DATE,\\n    NULL,\\n    true\\n  FROM upsert_user\\n  WHERE NOT EXISTS (\\n    SELECT 1 FROM \\"Core\\".employees e WHERE e.user_id = upsert_user.id\\n  )\\n  RETURNING id\\n)\\nSELECT\\n  (SELECT id FROM upsert_user) AS user_id,\\n  (SELECT id FROM ins_employee) AS employee_id,\\n  '={{(\\n      ($json.employee && $json.employee.email ? $json.employee.email : $json.email)\\n      || \\"demo.user@example.com\\"\\n    )}}' AS email,\\n  '={{(\\n      ($json.employee && $json.employee.name ? $json.employee.name : ($json.name || $json.full_name || $json.fullName))\\n      || \\"Demo User\\"\\n    )}}' AS name;","options":{}},"credentials":{"postgres":{"id":"JDnc3QjLCYRi8zNe","name":"Postgres account"}}}]	{"HRFlow Webhook Trigger":{"main":[[{"node":"HRFlow 12 trigger","type":"main","index":0}]]},"HRFlow 12 trigger":{"main":[[{"node":"HRFlow 13 email","type":"main","index":0}]]},"HRFlow 13 email":{"main":[[{"node":"HRFlow 14 database","type":"main","index":0}]]}}	\N	f	\N
